// SelectMeetingType.js

import React, { useState } from 'react';

const SelectMeetingType = ({ onNext }) => {
    const [meetingType, setMeetingType] = useState('');

    const handleSelectMeetingType = () => {
        onNext({ meetingType });
        // Redirect to the next step/page (e.g., service selection)
    };

    return (
        <div>
            <h1>Select Meeting Type</h1>
            <label>
                <input
                    type="radio"
                    name="meetingType"
                    value="online"
                    onChange={() => setMeetingType('online')}
                />
                Online
            </label>
            <label>
                <input
                    type="radio"
                    name="meetingType"
                    value="inPerson"
                    onChange={() => setMeetingType('inPerson')}
                />
                In Person
            </label>
            <button onClick={handleSelectMeetingType}>Next</button>
        </div>
    );
};

export default SelectMeetingType;
